import tensorflow as tf
import numpy as np
import base64
import cv2

model = None

# class names for prediction return
class_names = ['Tomato Bacterial spot', 'Tomato Early Blight', 'Tomato Late Blight',
               'Tomato Leaf Mold', 'Tomato Septoria Leaf Spot', 'Tomato Spider Mites Two Spotted Spider Mite',
               'Tomato Target Spot', 'Tomato YellowLeaf Curl Virus', 'Tomato Mosaic Virus',
               'Tomato Healthy']


def load_model():
    print("MODEL LOADING")
    tf.keras.models.load_model("./tomato.h5")  # Model dosyasının yolunu ayarlayın


def predict(image):
    global model

    if model is None:
        model = tf.keras.models.load_model("./tomato.h5")

    print("IMAGE IS BEING PROCESSED")
    # image_data = base64.b64decode(image)
    # image = Image.open(BytesIO(image_data))
    # image = np.array(Image.open(image).convert("RGB").resize((256, 256)))

    image = get_cv2_image_from_base64_string(image)
    image = cv2.resize(image, (256, 256))
    image = image / 255  # normalize the image in 0 to 1 range

    img_array = tf.expand_dims(image, 0)
    predictions = model.predict(img_array)

    # print("Predictions:", predictions)

    predicted_class = class_names[np.argmax(predictions[0])]
    confidence = round(100 * (np.max(predictions[0])), 2)
    print("POST RETURN")
    print("class", predicted_class, "confidence", confidence)
    return {"class": predicted_class, "confidence": confidence}


def get_cv2_image_from_base64_string(b64str):
    encoded_data = b64str.split(',')[1]
    nparr = np.frombuffer(base64.b64decode(encoded_data), np.uint8)
    img = cv2.imdecode(nparr, cv2.IMREAD_COLOR)
    return img


if __name__ == '__main__':

    base64_data = "data:image/jpeg;base64,"
    # Base64 veriyi dönüştürün

    predict(base64_data)
